import React from "react";
import { Link } from "react-router-dom";

function HeaderSignup(){

    let isloggedin = JSON.parse(localStorage.getItem("loginStats"))

    return(
        <Link to = "/Login">
        <div className="flex gap-10">
            <h1 className="hover:text-blue-500 text-xl">Log In</h1>
        </div>
        </Link>

)}

export default HeaderSignup
